        uint balance1Adjusted = balance1.mul(1000).sub(amount1In.mul(3)); // substitute 0.3% fee
        require(balance0Adjusted.mul(balance1Adjusted) >= uint(_reserve0).mul(_reserve1).mul(1000**2), 'TeleportDAO: K');
